import React from "react";
import "./style.css";
import Card from "@mui/material/Card";
import CardContent from "@mui/material/CardContent";
import CircleIcon from "@mui/icons-material/Circle";
import PieChartComponent from "../../Components/PieChart";

const paises = [
  { name: "Portugal", value: 500 },
  { name: "Espanha", value: 400 },
  { name: "França", value: 300 },
  { name: "Alemanha", value: 200 },
  { name: "Inglaterra", value: 100 },
  { name: "Suécia", value: 50 },
  { name: "Itália", value: 450 },
  { name: "Polónia", value: 20 },
];

function Home() {
  return (
    <div className="container">
      <div className="columnHome">
        <div className="container1">
          <Card sx={{ width: "100%", height: "100%" }}>
            <CardContent
              style={{
                display: "flex",
                flexDirection: "column",
                alignSelf: "center",
                alignItems: "center",
                justifyContent: "center",
              }}
            >
              <h2>Utilizadores Online</h2>
              <h1
                style={{
                  fontSize: "60px",
                  display: "flex",
                  alignItems: "center",
                }}
              >
                <CircleIcon style={{ color: "#26ca26", marginRight: "10px" }} />
                25 mil
              </h1>

              <p>100 mil esta semana</p>
            </CardContent>
          </Card>
        </div>
        <div className="container2">
          <h1>Países com mais transções</h1>
          <PieChart data={paises} />
        </div>
      </div>
      <div className="columnHome">
        <div className="container3">
          <h1>Paises com mais transações</h1>
        </div>
        <div className="container4">Não sei</div>
      </div>
    </div>
  );
}

export default Home;
